import styled from 'styled-components';

export const Container = styled.div`
    width: 100%;
    height: 70px;
    background: #20295F;
    border-top: 5px solid #EE6B26;
    display: flex;
    position: absolute;
    bottom: 0;
    display: flex;
    align-items: center;
    justify-content: center;

    p {
        color: #FFF;
        font-size: 18px;
        font-weight: bold;
    }
`;
